import React from 'react';
import { Browser as Router, Route, Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <Router>
      <div className="container">
        <h2>MERN APP</h2>
      </div>
    </Router>
  );
}

export default App;
